import PropTypes from 'prop-types';

class Filters extends Component {
  render() {
    const { onInputChange } = this.props;

    return(
      <div id="filtersContainer">
        <input
            id="searchBoxFilter"
            data-testid="name-filter"
            name="cardName"
            type="text"
            value={ cardName }
            onChange={ onInputChange }
          />
      </div>
    );
  }
}

export default Filters;
